import './App.css';
import { Header } from './component/header/Header';
import { createBrowserRouter,RouterProvider,Outlet } from 'react-router-dom';
import Body from './component/body/Body';
import { BodyModal } from './component/body/Bodymodal';


function App() {
  const Layout = ()=> {
    <div className='app_layout'>
      <div><Header/></div>
      <div className='app_outlet'><Outlet/></div>
      <div><BodyModal/></div>
    </div>
  }

  const router = createBrowserRouter([{path:"/",
  element:(<Layout/>),
  children:[{path:"/",element:<Layout/>},{path:"/openmodal",element:<BodyModal/>}]}]);

  return (
    <div className="App">
      <RouterProvider router={router}>
      </RouterProvider>
    </div>
  );
}

export default App;
